	<p>–°—Ç–≤–æ—Ä–µ–Ω–Ω—è –¥–µ—Ä–∂–∞–≤–Ω–∏—Ö —Å–∞–π—Ç—ñ–≤ –≤ –£–∫—Ä–∞—ó–Ω—ñ. –ó–∞—Ö–∏—Å—Ç –ø—Ä–∞–≤ —Å–ø–æ–∂–∏–≤–∞—á—ñ–≤ –ü—Ä–æ—Ç–∏–¥—ñ—è –¥–æ–º–∞—à–Ω—å–æ–º—É –Ω–∞—Å–∏–ª—å—Å—Ç–≤—É –°–ª—É–∂–±–∞ –∑–∞–π–Ω—è—Ç–æ—Å—Ç—ñ —ñ–Ω—Ñ–æ—Ä–º—É—î –ú–æ–ª–æ–¥—ñ–∂–Ω–∞ —Ä–∞–¥–∞ –ï–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ñ –ø–µ—Ç–∏—Ü—ñ—ó –ì–µ–Ω–µ—Ä–∞–ª—å–Ω–∏–π –ø–ª–∞–Ω –ü—Ä–æ–∑–æ—Ä–µ –ú—ñ—Å—Ç–æ –Ü–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π–Ω–∞ –¥—ñ—è–ª—å–Ω—ñ—Å—Ç—å –û—á–∏—â–µ–Ω–Ω—è –≤–ª–∞–¥–∏ –î–µ—Ä–∂–∞–≤–Ω—ñ –∑–∞–∫—É–ø—ñ–≤–ª—ñ –ê–Ω—Ç–∏–∫–æ—Ä—É–ø—Ü—ñ–π–Ω–∞ –ø–æ–ª—ñ—Ç–∏–∫–∞ –ì—Ä–æ–º–∞–¥—Å—å–∫–µ –æ–±–≥–æ–≤–æ—Ä–µ–Ω–Ω—è –†–µ—î—Å—Ç—Ä –∫–æ–º—É–Ω–∞–ª—å–Ω–æ–≥–æ –º–∞–π–Ω–∞ –ú—ñ—Å—å–∫–∞ –†–∞–¥–∞ –î–µ–ø—É—Ç–∞—Ç—Å—å–∫–∏–π –∫–æ—Ä–ø—É—Å –ó–≤—ñ—Ç–∏ –¥–µ–ø—É—Ç–∞—Ç—ñ–≤ –ü—Ä–æ—Ç–æ–∫–æ–ª–∏ –∫–æ–º—ñ—Å—ñ–π –ü–ª–µ–Ω–∞—Ä–Ω—ñ –∑–∞—Å—ñ–¥–∞–Ω–Ω—è –†–µ–∑—É–ª—å—Ç–∞—Ç–∏ –ø–ª–µ–Ω–∞—Ä–Ω–∏—Ö –≥–æ–ª–æ—Å—É–≤–∞–Ω—å –ü—Ä–æ—Ç–æ–∫–æ–ª–∏ –ø–ª–µ–Ω–∞—Ä–Ω–∏—Ö –∑–∞—Å—ñ–¥–∞–Ω—å –ü–æ—Ä—è–¥–æ–∫ –¥–µ–Ω–Ω–∏–π –ì—Ä–∞—Ñ—ñ–∫ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –ø–ª–µ–Ω–∞—Ä–Ω–∏—Ö –∑–∞—Å—ñ–¥–∞–Ω—å –ë—é–¥–∂–µ—Ç –û–¢–ì –ü—Ä–æ–µ–∫—Ç–∏ —Ä—ñ—à–µ–Ω—å –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏ –†—ñ—à–µ–Ω–Ω—è –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏ –†–µ–≥—É–ª—è—Ç–æ—Ä–Ω–∞ –ø–æ–ª—ñ—Ç–∏–∫–∞ –§—ñ–Ω–∞–Ω—Å–æ–≤–∞ –∑–≤—ñ—Ç–Ω—ñ—Å—Ç—å –∑–∞–∫–ª–∞–¥—ñ–≤ –æ—Å–≤—ñ—Ç–∏ –ö–æ–Ω—Ç–∞–∫—Ç–∏ –°–æ—Ü—ñ–∞–ª—å–Ω–æ-–µ–∫–æ–Ω–æ–º—ñ—á–Ω–∏–π —Ä–æ–∑–≤–∏—Ç–æ–∫ –ú–∞–ª–æ–≤–∏—Å–∫—ñ–≤—Å—å–∫–æ—ó –≥—Ä–æ–º–∞–¥–∏ –ü—ñ–¥–ø—Ä–∏—î–º–Ω–∏—Ü—Ç–≤–æ –ê–Ω—Ç–∏–∫–æ—Ä—É–ø—Ü—ñ–π–Ω–µ –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ –ó–µ–º–µ–ª—å–Ω—ñ –≤—ñ–¥–Ω–æ—Å–∏–Ω–∏ –ì–µ–Ω–¥–µ—Ä–Ω–∏–π –∫–æ–º–ø–æ–Ω–µ–Ω—Ç –ü–æ—Å–ª—É–≥–∏ –ë—é–¥–∂–µ—Ç –¥–ª—è –ì—Ä–æ–º–∞–¥—è–Ω –ú—ñ—Å—Ü–µ–≤—ñ –≤–∏–±–æ—Ä–∏ –í–∏ —Ç—É—Ç: –ì–æ–ª–æ–≤–Ω–∞ –ù–æ–≤–∏–Ω–∏.</p>
<p>–ö–∞–±—ñ–Ω–µ—Ç –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –∑–∞—Ç–≤–µ—Ä–¥–∏–≤ –ø–æ—Ä—è–¥–æ–∫ –∫–æ–º–ø–µ–Ω—Å–∞—Ü—ñ–π –¥–ª—è –ª—é–¥–µ–π, —è–∫—ñ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—é—Ç—å –µ–ª–µ–∫—Ç—Ä–æ–æ–ø–∞–ª–µ–Ω–Ω—è. –¢–∞–∫–∞ –∫–æ–º–ø–µ–Ω—Å–∞—Ü—ñ—è –±—É–¥–µ –Ω–∞—Ä–∞—Ö–æ–≤—É–≤–∞—Ç–∏—Å—è –∞–≤—Ç–æ–º–∞—Ç–∏—á–Ω–æ –Ω–∞ –æ—Å–æ–±–æ–≤—ñ —Ä–∞—Ö—É–Ω–∫–∏ —Å–ø–æ–∂–∏–≤–∞—á—ñ–≤. –î–æ–≤—ñ–¥–æ–∫ —á–∏ –∑–∞—è–≤ –ø–∏—Å–∞—Ç–∏ –Ω–µ —Ç—Ä–µ–±–∞. –ö–æ–º–ø–µ–Ω—Å–∞—Ü—ñ—ó –±—É–¥—É—Ç—å –≤–∏–ø–ª–∞—á—É–≤–∞—Ç–∏—Å—è –ª—é–¥—è–º, –¥–æ–º—ñ–≤–∫–∏ —è–∫–∏—Ö –æ–±–ª–∞–¥–Ω–∞–Ω—ñ –µ–ª–µ–∫—Ç—Ä–æ–æ–ø–∞–ª—é–≤–∞–ª—å–Ω–∏–º–∏ —É—Å—Ç–∞–Ω–æ–≤–∫–∞–º–∏ –π —É —è–∫–∏—Ö –±—É–¥–∏–Ω–∫–∏ –Ω–µ –≥–∞–∑–∏—Ñ—ñ–∫–æ–≤–∞–Ω—ñ, –∞–±–æ –Ω–µ –º–∞—é—Ç—å —Ü–µ–Ω—Ç—Ä–∞–ª—ñ–∑–æ–≤–∞–Ω–æ–≥–æ —Ç–µ–ø–ª–æ–ø–æ—Å—Ç–∞—á–∞–Ω–Ω—è. –ó–∞–≥–∞–ª–æ–º, –Ω–∞ –ø–æ–Ω–∞–¥ —Ç–∏—Å—è—á —É–∫—Ä–∞—ó–Ω—Å—å–∫–∏—Ö —Ä–æ–¥–∏–Ω –¥–µ—Ä–∂–∞–≤–∞ –≤–∏–¥—ñ–ª–∏—Ç—å 1,4 –º–ª—Ä–¥. –í–∞—Ä—Ç–æ –Ω–∞–≥–∞–¥–∞—Ç–∏: —É–∫—Ä–∞—ó–Ω—Ü—ñ, —É —è–∫–∏—Ö –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ –µ–ª–µ–∫—Ç—Ä–æ–æ–ø–∞–ª–µ–Ω–Ω—è, –æ—Ç—Ä–∏–º–∞—é—Ç—å –∫–æ–º–ø–µ–Ω—Å–∞—Ü—ñ—ó –∑–∞ –ø—ñ–¥–≤–∏—â–µ–Ω–Ω—è —Ç–∞—Ä–∏—Ñ—É –Ω–∞ –µ–ª–µ–∫—Ç—Ä–æ–µ–Ω–µ—Ä–≥—ñ—é –∑ 1‚Ä¶.</p>
<p>–ö–æ–ª–∏ –Ω–∞–≤—ñ—Ç—å –≤—ñ–¥ –∑–∞–ª—ñ–∑–æ–±–µ—Ç–æ–Ω–Ω–∏—Ö –ø–∞—Ç—Ä—ñ–æ—Ç—ñ–≤ –Ω—ñ—Ö—Ç–æ –Ω–µ —Å—Ç–∞–≤ –±–∏ –≤–∏–º–∞–≥–∞—Ç–∏ —è–∫–æ–≥–æ—Å—å —Ä—ñ—à—É—á–æ–≥–æ, –≥–µ—Ä–æ—ó—á–Ω–æ–≥–æ —á–∏ –ø—Ä–æ—Å—Ç–æ –±—ñ–ª—å—à-–º–µ–Ω—à –∞–∫—Ç–∏–≤–Ω–æ–≥–æ –≤—á–∏–Ω–∫—É. –ö–æ–ª–∏ –Ω–∞–π–±—ñ–ª—å—à –∑–±–∏—Ç—ñ —Ç–∞ –¥—ñ—î–≤—ñ –Ω–∞—Ü—ñ–æ–Ω–∞–ª—å–Ω—ñ –±—Ä–∏–≥–∞–¥–∏ —Ä–æ–∑–ø–æ–≤–∑–∞—é—Ç—å—Å—è –ø–æ —É–Ω—ñ–≤–µ—Ä—Å–∏—Ç–µ—Ç—Å—å–∫–∏—Ö –∞—É–¥–∏—Ç–æ—Ä—ñ—è—Ö, –∫–∞—Ñ–µ, –±–∞—Ä–∞—Ö, –¥–∏—Å–∫–æ—Ç–µ–∫–∞—Ö —ñ –¥–æ–º—ñ–≤–∫–∞—Ö. –ö–æ–ª–∏ –Ω–µ —Ä–æ–∑–¥–∞—é—Ç—å—Å—è –ª–∏—Å—Ç—ñ–≤–∫–∏, –Ω–µ –∫–ª–µ—è—Ç—å—Å—è –ø–ª–∞–∫–∞—Ç–∏, –Ω–µ –ø—Ä–æ–≤–æ–¥—è—Ç—å—Å—è –≤–∏—à–∫–æ–ª–∏, –Ω–µ –æ—Ä–≥–∞–Ω—ñ–∑–æ–≤—É—é—Ç—å—Å—è –º–∞—Ä—à—ñ, —ñ –Ω–∞–≤—ñ—Ç—å –∞–∫—Ü—ñ—ó –ø—Ä—è–º–æ—ó –¥—ñ—ó –≤–∏–ª–∏–≤–∞—é—Ç—å—Å—è —É –±–µ–∑—Ä–µ–∑—É–ª—å—Ç–∞—Ç–∏–≤–Ω—É –±—ñ–≥–∞–Ω–∏–Ω—É –ø–æ—Ä–æ–∂–Ω—ñ–º–∏ –≤—É–ª–∏—Ü—è–º–∏. –ù–∞–¥—Ç–æ —Ö–æ–ª–æ–¥–Ω–æ –¥–ª—è –º—ñ—Ç–∏–Ω–≥—ñ–≤, –Ω–∞–¥—Ç–æ –º–æ–∫—Ä–æ –¥–ª—è —Ä–µ–≤–æ–ª—é—Ü—ñ—ó.</p>
<p>–ü–æ–≤–Ω–æ—Ç–∞ –±—É—Ç—Ç—è. –Ü –¥—ñ–≤—á–∞—Ç–∞. –•–æ–ª–æ–¥–Ω—ñ —Ç–∞ –ø—Ä–µ–∫—Ä–∞—Å–Ω—ñ.</p><strong><a id='p3'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –ú–∞–ª–∞ –í–∏—Å–∫–∞</h2></strong><p>–ì–ª–∞–º—É—Ä–Ω—ñ, –±–µ–∑—Ç—É—Ä–±–æ—Ç–Ω—ñ —Ç–∞ –∑–∞—á–∞—Ä–æ–≤—É—é—á—ñ. –°—å–æ–≥–æ–¥–Ω—ñ –≤–æ–Ω–∏ –Ω–µ –∑ –Ω–∞–º–∏. –¢–æ–±—Ç–æ, –Ω–∞—Å —Ç–∞–º –Ω–µ–º–∞—î. –¢–∞ –æ–¥–Ω–∞–∫–æ–≤–æ –º–∏ –Ω—ñ—á–æ–≥–æ –æ—Å–æ–±–ª–∏–≤–æ–≥–æ –Ω–µ –ø—Ä–æ–ø—É—Å—Ç–∏–ª–∏. –í–æ–Ω–∏ –Ω—É–¥–Ω–∏–º —Ç–æ–Ω–æ–º —á–∏—Ç–∞—Ç–∏–º—É—Ç—å –Ω–∞–º –Ω–æ—Ç–∞—Ü—ñ—ó, —â–æ —É –Ω–∞—Å –Ω—ñ–∫–æ–ª–∏ –Ω—ñ—á–æ–≥–æ –Ω–µ –≤–∏–π–¥–µ, —ñ –≤—Å—ñ—Ö –Ω–∞—Å –ø–æ—Å–∞–¥—è—Ç—å. –ê —Ç–æ–¥—ñ –ø–æ–≤–∏—Å–∫–∞–∫—É—é—Ç—å –∑–∞–º—ñ–∂ –∑–∞ —è–∫–∏—Ö-–Ω–µ–±—É–¥—å –±–æ–≤–¥—É—Ä—ñ–≤. –ó–∞ –±–æ–≤–¥—É—Ä—ñ–≤ —ñ –ø–∞–¥–ª—é–∫. –ê —Ç–∞–∫ —É—Å—ñ–º –¥–æ–±—Ä–µ. –ú–∏ –≤—ñ—Ç–∞—î–º–æ –æ—Å—ñ–Ω—å, –≤—ñ—Ç–∞—î–º–æ —ó—ó —Å—ñ—Ä—ñ —Ö–º–∞—Ä–∏, —ó—ó —Ö–æ–ª–æ–¥–Ω—ñ –≤—ñ—Ç—Ä–∏, —ó—ó —Ç—É–º–∞–Ω–Ω—ñ —Å—É—Ç—ñ–Ω–∫–∏, —ó—ó –æ–ø–∞–ª–µ –ª–∏—Å—Ç—è.</p><strong><a id='p4'></a><h2>–ú–∞–ª–∞ –í–∏—Å–∫–∞</h2></strong><p>–ú–∏ –≤—ñ—Ç–∞—î–º–æ —ó—ó –ø—ñ–¥–Ω—è—Ç–æ—é –¥–æ –Ω–µ–≤–∏–¥–∏–º–æ–≥–æ —Å–æ–Ω—Ü—è –ø—Ä–∞–≤–∏—Ü–µ—é, —è–∫ –≤—ñ—Ç–∞–ª–∏ –∫–æ–ª–∏—Å—å –Ω–∏–Ω—ñ –º–µ—Ä—Ç–≤–∏—Ö –≤–æ–∂–¥—ñ–≤ —ñ –∑–Ω–∏–∫–ª—ñ –±–µ–∑–≤—ñ—Å—Ç–∏ –ª–µ–≥—ñ–æ–Ω–∏ –ø–µ—Ä–µ–º–æ–∂—Ü—ñ–≤. –ú–∏ –≤—ñ—Ç–∞—î–º–æ —ó—ó –∑–∞–≤–º–∏—Ä–∞–Ω–Ω—è–º —Å–µ—Ä—Ü—è —Ç–∞ —Å—Ç–∏—Å–Ω—É—Ç–∏–º–∏ –¥–æ –±–æ–ª—é –∑—É–±–∞–º–∏. –ù–µ–≤–∞–∂–∫–æ –ø–µ—Ä–µ–≤—ñ—Ä–∏—Ç–∏, —á–∏ –≥–æ—Ç–æ–≤–∏–π —Ç–∏ –≤–∫–æ—Ç—Ä–µ –ø–µ—Ä–µ–±–æ—Ä–æ—Ç–∏ —Å–µ–±–µ —ñ –∑–Ω–æ–≤—É —Å—Ç–∞—Ç–∏ –Ω–∞ –æ–±—Ä–∞–Ω–∏–π —à–ª—è—Ö, –∑–∞–±—É–≤—à–∏ –ø—Ä–æ –º–∏—Ç—å —Å–ª–∞–±–∫–æ—Å—Ç—ñ. –¶–µ —Ç–µ, —â–æ –≤ —Ç–æ–±—ñ —î, –∞–±–æ –π–æ–≥–æ –Ω–µ –±—É–ª–æ, –Ω–µ–º–∞—î —ñ –Ω—ñ–∫–æ–ª–∏ –Ω–µ –±—É–¥–µ.</p>
<p>–¶–µ –Ω–µ–º–∏–Ω—É—á–µ, —è–∫ –∑–∞–∫–æ–Ω –≤—Å–µ—Å–≤—ñ—Ç–Ω—å–æ–≥–æ —Ç—è–∂—ñ–Ω–Ω—è. –¢–∏ –ø–æ–¥–æ–ª–∞—î—à —Ö–≤–∏–ª–∏–Ω–Ω–µ —Ç—Ä–µ–º—Ç—ñ–Ω–Ω—è —Ä—É–∫ —Ç–∞ —Ö–æ–ª–æ–¥–æ–∫ –ø—ñ–¥ —Å–µ—Ä—Ü–µ–º, –∑–∞–±—É–¥–µ—à –ø—Ä–æ —Ü—é –æ—Å—ñ–Ω–Ω—é –º–∞—è—á–Ω—é —Ç–∞ –ø—ñ–¥–µ—à —Å–≤–æ—î—é –¥–æ—Ä–æ–≥–æ—é —Å–æ—Ü—ñ–∞–ª-–Ω–∞—Ü—ñ–æ–Ω–∞–ª—ñ—Å—Ç–∞. –î–æ –Ω–∞—Å—Ç—É–ø–Ω–æ—ó –æ—Å–µ–Ω—ñ. –ß–µ–º–Ω–æ –≤–∏—Å–ª—É—Ö–æ–≤—É—î—à –π–æ–≥–æ –º—ñ—Ä–∫—É–≤–∞–Ω–Ω—è –∑ –ø—Ä–∏–≤–æ–¥—É —Å–≤–æ—ó—Ö –ø–æ–¥–∞–ª—å—à–∏—Ö –ø–µ—Ä—Å–ø–µ–∫—Ç–∏–≤, –∞ —Ç–æ–¥—ñ –≤–≤—ñ—á–ª–∏–≤–æ –≤—Å–º—ñ—Ö–∞—î—à—Å—è —ñ —Ç–∏—Ö–æ –∑–∞–≥–ª—è–¥–∞—î—à –π–æ–º—É —É –≤—ñ—á—ñ, –≤—ñ–¥ —á–æ–≥–æ –≤—ñ–Ω –±–ª—ñ–¥–Ω–µ —ñ –∑–∞–∫—Ä–∏–≤–∞—î –ø–µ–ª—å–∫—É.</p>
<p>–í—ñ–Ω –±–∞—á–∏—Ç—å —Å–º–µ—Ä—Ç—å —É —Ç–≤–æ—ó—Ö –æ—á–∞—Ö, —ñ –≤—ñ–¥—Å—Ç—É–ø–∞—î. –ù–∞ –≤—Å–µ –ø—Ä–∏–π–¥–µ —á–∞—Å —Ä–æ–∑–ø–ª–∞—Ç–∏. –¶–µ —Å—å–æ–≥–æ–¥–Ω—ñ –≤–æ–Ω–∏ –≥–æ—Å–ø–æ–¥–∞—Ä—ñ –∂–∏—Ç—Ç—è, –∞ –≤–∂–µ –∑–∞–≤—Ç—Ä–∞ —ó–º –¥–æ–≤–µ–¥–µ—Ç—å—Å—è —Å–ø–ª–∞—Ç–∏—Ç–∏ —Ä–∞—Ö—É–Ω–∫–∏. –°—å–æ–≥–æ–¥–Ω—ñ –º–∏ ‚Äî –∞—Ä—Ç–µ—Ñ–∞–∫—Ç–∏. –ù–∞—Å –∑–∞–ª–∏—à–∏–ª–æ—Å—å —Ç–∞–∫ –º–∞–ª–æ, —â–æ –æ–∫—É–ø–∞–Ω—Ç–∏ –ø—Ä–æ—Å—Ç–æ —Å–∫–∏–Ω—É–ª–∏ –Ω–∞—Å —ñ–∑ —Ä–∞—Ö—É–Ω–∫—É —Ç–∞ –∑–∞–π–Ω—è–ª–∏—Å—å —Å–≤–æ—ó–º–∏ –±—É–¥–µ–Ω–Ω–∏–º–∏ —Å–ø—Ä–∞–≤–∞–º–∏ ‚Äî –≥–µ–Ω–æ—Ü–∏–¥–æ–º —É–∫—Ä–∞—ó–Ω—Ü—ñ–≤ —ñ —Ä–æ–∑–ø—Ä–æ–¥–∞–∂–µ–º –∑–∞–ª–∏—à–∫—ñ–≤ –Ω–∞—Ü—ñ–æ–Ω–∞–ª—å–Ω–æ–≥–æ –±–∞–≥–∞—Ç—Å—Ç–≤–∞. –ê–ª–µ –Ω–∞—Å –≤–æ–Ω–∏ –≤—Å–µ —â–µ –Ω–µ–Ω–∞–≤–∏–¥—è—Ç—å ‚Äî –æ—Ç–∂–µ, –≤—Å–µ —â–µ –±–æ—è—Ç—å—Å—è. –ê —Ü–µ –æ–∑–Ω–∞—á–∞—î, —â–æ –º–∏, —Å–æ—Ü—ñ–∞–ª-–Ω–∞—Ü—ñ–æ–Ω–∞–ª—ñ—Å—Ç–∏, –∂–∏–≤—ñ. –ñ–∏–≤—ñ—à—ñ –∑–∞ —Ç–∏—Ö, —Ö—Ç–æ –¥—É–º–∞—î, –Ω–∞—á–µ –∑–Ω–∞—î –∂–∏—Ç—Ç—è. –ñ–∏–≤—ñ –Ω–∞—Å—Ç—ñ–ª—å–∫–∏, —â–æ –Ω–∞—à—ñ –º–µ—Ä—Ç–≤—ñ –¥–∏–≤–ª—è—Ç—å—Å—è –Ω–∞ –Ω–∞—Å —ñ–∑ –Ω–µ–±–µ—Å —ñ —Ç–∏—Ö–∏–º–∏ —Ç—ñ–Ω—è–º–∏ –≤–∏—Ä–æ—Å—Ç–∞—é—Ç—å –∑–∞ –ø–ª–µ—á–∏–º–∞, –∫–æ–ª–∏ –Ω–∞–º –∑–æ–≤—Å—ñ–º —Å—É—Ç—É–∂–Ω–æ.</p>
<p>–¢–∏ –Ω–µ –º–∞—î—à –ø—Ä–∞–≤–∞ –Ω–∞ —Å–ª–∞–±–∫—ñ—Å—Ç—å, –ø—Ä–∞–≤–∞ –Ω–∞ –≤—ñ–¥—á–∞–π, –ø—Ä–∞–≤–∞ –Ω–∞ —Ä–æ–∑—á–∞—Ä—É–≤–∞–Ω–Ω—è. –¢–∏ ‚Äî —Ä–µ–≤–æ–ª—é—Ü—ñ–π–Ω–∏–π —Å–æ—Ü—ñ–∞–ª-–Ω–∞—Ü—ñ–æ–Ω–∞–ª—ñ—Å—Ç. –¢–≤–æ—ó–º–∏ —Ä—É–∫–∞–º–∏ –£–∫—Ä–∞—ó–Ω–∞ –∫–∞—Ä–∞—Ç–∏–º–µ –≤–æ—Ä–æ–≥—ñ–≤ —ñ –±—É–¥—É–≤–∞—Ç–∏–º–µ –º–∞–π–±—É—Ç–Ω—î, —Ç–≤–æ—ó–º —Å–µ—Ä—Ü–µ–º –£–∫—Ä–∞—ó–Ω–∞ –±—É–¥–µ –ª—é–±–∏—Ç–∏ –π –Ω–µ–Ω–∞–≤–∏–¥—ñ—Ç–∏, —Ç–≤–æ—ó–º–∏ –≥—Ä—É–¥—å–º–∏ –£–∫—Ä–∞—ó–Ω–∞ –∑–∞–∫—Ä–∏–≤–∞—Ç–∏–º–µ —Å–≤—ñ—Ç –≤—ñ–¥ –∫—Ä–∏–≤–¥–∏ —ñ –ø—Ä–∏–≥–æ—Ä—Ç–∞—Ç–∏–º–µ —Å–≤–æ—ó—Ö –¥—ñ—Ç–µ–π. –¢–æ–±–æ—é –¥–∏—Ö–∞—Ç–∏–º–µ —Ä–µ–≤–æ–ª—é—Ü—ñ—è. –¢–æ–±–æ—é –¥–∑–≤–µ–Ω—ñ—Ç–∏–º–µ —Å—Ç–∞–ª—å. –¢–æ–±–æ—é –ø–∏—à–∞—Ç–∏–º—É—Ç—å—Å—è –Ω–∞—â–∞–¥–∫–∏. –¢–æ–±–æ—é, –∞–ª–µ –±–µ–∑ —Ç–µ–±–µ.</p>
		
			<br><ol>
			
				<li>–∑–Ω–∞–π–æ–º—Å—Ç–≤–∞ –ø–ª—é—Å —Ä–æ–∑–º—ñ—Ä –î–æ–∫—É—á–∞—î–≤—Å—å–∫ –£–∫—Ä–∞—ó–Ω–∞.</li>
			
				<li>–æ—Ñ—ñ—Ü—ñ–π–Ω–∏–π —Å–∞–π—Ç.</li>
			
				<li>–Ω–∞–π–∫—Ä–∞—â–∏–π —Å–∞–π—Ç –∑–Ω–∞–π–æ–º—Å—Ç–≤ –ë—ñ–ª–æ–∑–µ—Ä—Å—å–∫–µ –£–∫—Ä–∞—ó–Ω–∞.</li>
			
			</ol>
		
	<p>–£ –Ω–∞—Å —Å–≤—ñ–π —à–ª—è—Ö, —Å–≤–æ—è –ì–æ–ª–≥–æ—Ñ–∞ —ñ —Å–≤—ñ–π –ø—Ä–∏—Å—É–¥ —ñ—Å—Ç–æ—Ä—ñ—ó. –¢–∏ –π–¥–µ—à —á–∏—Å—Ç–æ –≤–º–∏—Ç–æ—é –¥–æ—â–µ–º –±—Ä—É–∫–æ–≤–∞–Ω–æ—é –≤—É–ª–∏—Ü–µ—é, —â–æ –ø—ñ–¥–Ω—ñ–º–∞—î—Ç—å—Å—è –≤–≥–æ—Ä—É, –≤–ø–µ–≤–Ω–µ–Ω–∏–π —É —Å–æ–±—ñ, —Å—Ç—Ä—É–Ω–∫–∏–π —ñ —Å–ø–æ–∫—ñ–π–Ω–∏–π, —ñ –Ω–µ –æ–±–µ—Ä—Ç–∞—î—à—Å—è –Ω–∞–∑–∞–¥. –ù—ñ–∫–æ–ª–∏ –Ω–µ –æ–±–µ—Ä—Ç–∞—î—à—Å—è. –ë–æ –∑–∞–≤—Ç—Ä–∞ –±—É–¥–µ –Ω–æ–≤–∏–π –¥–µ–Ω—å. –ó–≤–∏—á–∞–π–Ω–∏–π –¥–µ–Ω—å –ø—Ä–æ—Å—Ç–∏—Ö, –∞–ª–µ –¥–æ–ª–µ–Ω–æ—Å–Ω–∏—Ö —Ä—ñ—à–µ–Ω—å. –ì–æ–ª–æ—Å –ë—ñ–ª–æ—ó –†–∞—Å–∏ 20 –æ–∫—Ç –≤  –ù–µ—Å–∫—ñ–Ω—á–µ–Ω–Ω—ñ "—ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω—ñ –ø—Ä–∏–≤–æ–¥–∏" –∑ –º—ñ—Å—Ü—è —Ä–æ–∑–≤'—è–∑–∞–Ω–æ–≥–æ –∑–±—Ä–æ–π–Ω–æ–≥–æ –∫–æ–Ω—Ñ–ª—ñ–∫—Ç—É, —ñ–º–µ–Ω–æ–≤–∞–Ω–æ–≥–æ, –∑ –æ–¥–Ω–æ–≥–æ –±–æ–∫—É, –ê–¢–û, –∑ —ñ–Ω—à–æ–≥–æ - "—Å–≤—è—â–µ–Ω–Ω–æ—é –≤—ñ–π–Ω–æ—é –ø—Ä–æ—Ç–∏ —Ñ–∞—à–∏–∑–º—É", –∑–∞–±–µ–∑–ø–µ—á–∏–ª–∏ "–Ω–µ —Ö–∏—Ç—Ä–æ—é" —Ä–æ–±–æ—Ç–æ—é –¥–µ—Å—è—Ç–∫–∏ –±–∞–ª–∞–∫—É–Ω—ñ–≤.</p>
<p>–®–æ—É –≤–∏—Ö–æ–¥—è—Ç—å —â–æ–¥–Ω—è, –∫–æ–Ω–≤–µ—î—Ä –ø—Ä–∞—Ü—é—î.</p>
		
	<p>–•–æ—Ç—ñ–ª–æ—Å—è –± –∑—Ä–æ–±–∏—Ç–∏ –æ—Å–æ–±–ª–∏–≤–∏–π –∞–∫—Ü–µ–Ω—Ç –Ω–∞ –¥–≤–æ—Ö –ø–µ—Ä—Å–æ–Ω–∞—Ö, —è–∫—ñ –≤–∂–µ –±—É–∫–≤–∞–ª—å–Ω–æ "–ø—Ä–æ–ø–∏—Å–∞–ª–∏—Å—è" –Ω–∞ —Ä–æ—Å—ñ–π—Å—å–∫–æ–º—É –±–ª–∞–∫–∏—Ç–Ω–æ–º—É –µ–∫—Ä–∞–Ω—ñ. –¶–µ –°–∞—à–∞ –ö–æ—Ñ–º–∞–Ω, –≤—ñ—Ü–µ-—Å–ø—ñ–∫–µ—Ä –ù–æ–≤–æ—Ä–æ—Å—ñ—ó, —ñ –ë–æ—Ä–∏—Å –ù–∞–¥—î–∂–¥—ñ–Ω, –∫–æ–ª–∏—Å—å –¥–µ–ø—É—Ç–∞—Ç –ø—Ä–∞–≤–æ-–ª—ñ–±–µ—Ä–∞–ª—å–Ω–æ–≥–æ —Å–ø—Ä—è–º—É–≤–∞–Ω–Ω—è. –ß–∏ —Ç–æ—á–Ω–æ —ó—Ö –¥–≤–æ—î? –Ø–∫—â–æ –ø—Ä–∏–¥–∏–≤–∏—Ç–∏—Å—è —É–≤–∞–∂–Ω–æ, —Ç–æ –º–æ–∂–Ω–∞ –ø–æ–º—ñ—Ç–∏—Ç–∏, —â–æ —Ü–µ –æ–¥–∏–Ω —ñ —Ç–æ–π –∂–µ –ø–µ—Ä—Å–æ–Ω–∞–∂. –Ñ–¥–∏–Ω–∏–π –≤ –¥–≤–æ—Ö –æ—Å–æ–±–∞—Ö. –í—ñ—á–Ω–∏–π –∂–∏ –í—ñ—á–Ω–∏–π –∂–∏—Ç—Ç—î—Ä–∞–¥—ñ—Å–Ω–∏–π –õ–µ–ø–µ—Ç—É–Ω, —à–∞—Ä–º–∞–Ω—â–∏–∫, —Ñ—Ä–∞–∑—ë—Ä. –•—Ç–æ –∑ –Ω–∏—Ö —Ü—å–æ–≥–æ —Ä–∞–∑—É –≤—ñ—â–∞—î, –≤–∏ –Ω–µ –≤—ñ–¥—Ä–∞–∑—É —ñ —Ä–æ–∑–±–µ—Ä–µ—Ç–µ—Å—è, —è–∫—â–æ –ø–æ–±–∞—á–∏—Ç–µ —ó—Ö "—É —Å–ø—Ä–∞–≤—ñ". –ê–ª–µ –≤—ñ—â–∞—é—Ç—å –≤–æ–Ω–∏ "–≤—ñ–¥ —ñ–º–µ–Ω—ñ –Ω–∞—Ä–æ–¥—É". –ü—Ä–∏—á–æ–º—É –∑–∞–π–º–∞—é—Ç—å –¥—ñ–∞–º–µ—Ç—Ä–∞–ª—å–Ω–æ –ø—Ä–æ—Ç–∏–ª–µ–∂–Ω—ñ –ø–æ–∑–∏—Ü—ñ—ó –≤ "—Ç–µ–ª–µ–¥–µ–±–∞—Ç–∞—Ö".</p>
<p>–ê –æ—Å—å –ù–∞–¥—î–∂–¥—ñ–Ω, –≤—ñ–¥—Ä–∞–∑—É –≤–∏–¥–Ω–æ, –≥–∞–¥–∏–Ω–∞ –ª—ñ–±–µ—Ä–∞–ª—å–Ω–∞! –ù—É, —Ç–≤—ñ–π –ö–æ—Ñ–º–∞–Ω, –ø—Ä–∏–ø—É—Å—Ç–∏–º–æ, –≤—ñ–¥–æ–º–æ –∑ —á–∏—î—ó —Ä—É–∫–∏ –≥–æ–¥—É—î—Ç—å—Å—è.</p>
